self.label = Label::new("0").build(state, row, |builder| builder .set_width(Pixels(100.0)) .set_height(Pixels(30.0))
); Finally, we need to update the label text in the on_event method: fn on_event(&mut self, state: &mut State, entity: Entity, event: &mut Event) { if let Some(counter_event) = event.message.downcast() { match counter_event { CounterEvent::Increment => { self.value += 1; self.label.set_text(state, &self.value.to_string()); } CounterEvent::Decrement => { self.value -= 1; self.label.set_text(state, &self.value.to_string()); } } }
} We can do it this way because the label text is a property which we can set using state. If this was a more complicated widget then we could update it using an event targeted at the label. We're finally done! You can find the full code for this guide so far in the examples/counter.rs file in the tuix repository. Run with cargo run --release --example counter.
